import React, { Fragment } from "react";
import Navigation from "../Components/navigation";
import FooterBar from "../Components/footer";
import ListLevels from "../Components/ListLevels";
import { Row, Col } from "react-bootstrap";

const Home = () => {

    return (
        <Fragment>
            <Navigation />
            <Row className="show-grid" style={{ margin: '10px 10px 10px 10px' }}>
                <Col xs={2} md={2} style={{ margin: '10px 10px 10px 10px' }}>
                        <ListLevels />
                    </Col>
                    <Col xs={10} md={10}>
                        <ListLevels />
                    </Col>
            </Row>
            <FooterBar />
        </Fragment>
    );
};

export default Home;
